import React from "react";
import  ReactDOM  from "react-dom";
import "./styles.css";

function somar(n1, n2){
    return n1+n2;
}



const App = () =>{

    return (
        <div className="App">
            Hello World
            <h1>{somar(2,2)}</h1>
        </div>

    )
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
